class Data {
  Data({
    num? id,
    String? name,
    List<Cities>? cities,
  }) {
    _id = id;
    _name = name;
    _cities = cities;
  }

  Data.fromJson(dynamic json) {
    _id = json['id'];
    _name = json['name'];
    if (json['cities'] != null) {
      _cities = [];
      json['cities'].forEach((v) {
        _cities?.add(Cities.fromJson(v));
      });
    }
  }

  num? _id;
  String? _name;
  List<Cities>? _cities;

  Data copyWith({
    num? id,
    String? name,
    List<Cities>? cities,
  }) =>
      Data(
        id: id ?? _id,
        name: name ?? _name,
        cities: cities ?? _cities,
      );

  num? get id => _id;

  String? get name => _name;

  List<Cities>? get cities => _cities;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['name'] = _name;
    if (_cities != null) {
      map['cities'] = _cities?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

